INSERT INTO `engine4_groupbuy_deals` (`deal_id`, `user_id`, `category_id`, `location_id`, `is_delete`, `status`, `stop`, `start_time`, `end_time`, `featured`, `creation_date`, `view_count`, `rates`, `current_sold`, `max_sold`, `comment_count`, `currency`, `min_sold`, `title`, `value_deal`, `discount`, `total_fee`, `price`, `vat`, `final_price`, `latitude`, `longitude`, `published`, `company_name`, `address`, `phone`, `website`, `photo_id`, `fine_print`, `features`, `description`, `timezone`, `modified_date`) VALUES
(1, 54, 6, 6, 0, 30, 0, '2011-08-01 00:00:00', '2011-08-18 08:00:00', 1, '2011-08-03 11:11:11', 44, 4, 11, 100, 2, 'USD', 50, 'Newfoundland Paintball Supply  Multiple Locations', 100.00, 80, '9.00', 20.00, 0.00, 0.00, 0, 0, 20, 'Newfoundland Paintball Supply ', '799 Water St. St. John''s, Newfoundland A1C 1E3 ', '(709) 726-9932 ', 'http://newfoundlandpaintballsupply.com/sf-dev/', 969, '<ul>\r\n<li>xpires in 1 year</li>\r\n<li>Limit 1 per person, may buy 2 additional as gifts for 2 person outdoor package. Limit 1 per visit. Valid only for option purchased. Must be 10 or older, under 18 must be accompanied by guardian. Must sign waiver.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>More than two acres of wooded outdoor field</li>\r\n<li>Includes basic equipment rental</li>\r\n<li>Domino''s pizza & soft drinks</li>\r\n</ul>', '<p>If the Hundred Years'' War had been fought with paintballs instead of rifles, it might still be happening, but it''d be so colourful that no one would mind. Experience your own vibrant battlefield with today''s Groupon to <a href="http://www.newfoundlandpaintballsupply.com/">Newfoundland Paintball Supply</a>. Choose between the following options:</p>\r\n<p><br> * For $29, you get a two-hour outdoor paintball package for two including field fee (a $15 value each), basic equipment rental (a $6 value each), and 100 paintballs (an $8 value each; a $58 total value). <br> * For $175, you get a two-hour private paintball party package on a Saturday or Sunday for up to 10 players including field fee for 90 minutes of play (a $15 value each), basic equipment rental (a $6 value each), 1,000 total paintballs (a $56 value), coveralls (a $3 value each), and a house referee, plus a half hour in the outdoor party area with two extra large pepperoni pizzas from Domino''s (a $37 value) and two litres of soft drinks (a $6 value; up to a $339 total value). More people may be added at standard rates.</p>\r\n<p><img src="http://3.bp.blogspot.com/-WZ7n1KDWHeo/TcNYVYVX62I/AAAAAAAAAAw/USxpaBN-cBo/s1600/paintball.jpg" alt="" width="477" height="356"></p>\r\n<p>&nbsp;</p>\r\n<p>Newfoundland Paintball Supply equips duos and groups of marksmen with the paint and tools needed to vibrantly ambush opponents while combating on their numerous fields, which include an outdoor wooded field that spans more than two-acres, plus an outdoor urban field slated to open later this summer. After donning a mask, mechanical marker, gravity fed hopper, and full HPA or 12-ounce CO2 tank, ordinary citizens channel the artistry of Henri Matisse and the aggression of a hungry badger to bespatter adversaries with colourful marks of defeat. Triggermen glide across fields during scenario games such as Elimination, Capture the Flag, and Find/Disarm the Bomb, scoping the natural terrain to find cover, create ambush points, and discover new species of talking insect.</p>\r\n<p><img src="http://3.bp.blogspot.com/_p65wJCAooek/TKDCIEGu-NI/AAAAAAAAACY/HU1AjFgIaj0/s1600/digital_paint_ball.jpg" alt=""></p>\r\n<p>Up to ten friends can settle literary debates during a two-hour private paintball party package. After proving dominance over the colour spectrum, players can refuel with two cheesy Domino''s pizzas and two litres of soft drink, ideal tools for proving dominance over the chugging spectrum. Those wanting more firepower may upgrade to an electronic or response-trigger marker ($6, subject to availability). Extra paintballs start at $8 for 100 rounds (only field paint allowed), and tanks may be refilled with air ($1.30 per 1000 psi of HPA/nitrogen; $0.40/oz. of CO2).</p>\r\n', NULL, '2011-08-03 11:14:09'),
(2, 54, 7, 6, 0, 30, 0, '2011-08-01 00:00:00', '2011-08-17 08:00:00', 1, '2011-08-03 11:54:42', 30, 5, 23, 100, 0, 'USD', 4, 'Dooly''s  West End', 201.00, 90, '9.00', 21.00, 0.00, 0.00, 0, 0, 20, 'Dooly''s ', '799 Water St. St. John''s, Newfoundland A1C 1E3', '(709) 726-9932', 'http://www.yahoo.com', 973, '<ul>\r\n<li>Expires Feb 4, 2012</li>\r\n<li>Limit 1 per person, may buy 2 additional as gifts. Limit 1 per visit. Must be 19 or older.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>Award-winning pool hall</li>\r\n<li>Upscale billiards tables</li>\r\n<li>Molson draft beer</li>\r\n<li>Sofas & fireplace</li>\r\n</ul>', '<div>\r\n<p>Like an Easter egg hunt at a chicken-pox ward, billiards asks you to pocket striped orbs while trying not to scratch. Keep your mind on the game with today''s Groupon: for $18, you get two hours of pool (a $25 value) and a pitcher of beer (an $11.25 value) at <a href="http://gr.pn/qZhCnW">Dooly''s</a> (a $36.25 total value).</p>\r\n<p><img src="http://a9.vietbao.vn/images/vi955/2010/2/55281969-1266969665_Gai-Billiard_04.jpg" alt="" width="200" height="200"></p>\r\n<p>Voted Best Place to Play Pool by <a href="http://gr.pn/qk6omj">the <em>Scope</em></a>, Dooly''s encompasses a sprawling billiards hall brimming with upscale pool tables. Mellifluous tones travel from a stereo system toward ear trumpets as players wage one-on-one billiard battles and attempt to pocket a secret target during games of <a href="http://gr.pn/oO9eLQ">pea pool</a>. At the bar, a stream of Molson draft rains from the tap and tops off a pitcher of beer perfect for quenching the thirst of highly concentrated nine-ball players.</p>\r\n<p><img src="http://a9.vietbao.vn/images/vi955/2010/2/55281969-1266969551-Gai-Billiard_46.jpg" alt="" width="371" height="528"></p>\r\n<p>&nbsp;</p>\r\n<p>Players watch TV and exchange respectful head nods while lounging on sofas in front of a fireplace after games, as their doppelgangers play video games and both classic and modern board games. Though not included in today''s Groupon, Dooly''s serves up an assortment of wine, snacks, and eats.</p>\r\n<p><img src="http://www.clovisdesign.com/IDS/images/photo-billiards-3.jpg" alt="" width="400" height="300"></p>\r\n</div>', NULL, '2011-08-03 11:54:42'),
(3, 54, 2, 6, 0, 30, 0, '2011-08-01 00:00:00', '2011-08-17 13:00:00', 1, '2011-08-03 12:07:41', 13, 0, 3, 100, 0, 'USD', 19, 'Moonrise Hotel  St. Louis, Missouri', 2000.00, 90, '6.00', 200.00, 0.00, 0.00, 0, 0, 20, 'Moonrise Hotel', 'St. Louis, Missouri  6177 Delmar Blvd. St. Louis, Missouri 63112 ', '(314) 721-1111 ', 'http://www.gmail.com', 1006, '<ul>\r\n<li>Expires Mar 31, 2012</li>\r\n<li>Limit 4 per person</li>\r\n<li>Limit 4 per visit</li>\r\n<li>48-hour cancellation notice or fee up to the price of Groupon may apply</li>\r\n<li>Not valid 8/24-8/27, 10/20-10/28, 12/30-12/31, or 2/11/12</li>\r\n<li>Must be 21 or older to check in</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>For $119, a one-night weekday stay (Sun.&ndash;Thurs.) in a Superior two-queen room or Superior king room</li>\r\n<li>Or, for $129, a one-night weekend stay (Fri.&ndash;Sat.) in a Superior two-queen room or Superior king room<br><br><strong>Included in both options:</strong></li>\r\n<li>Breakfast for two at Eclipse Restaurant</li>\r\n<li>Valet parking with 24-hour in-and-out privileges</li>\r\n</ul>', '<h4>Fashionably Eccentric Boutique Hotel in One of St. Louis&rsquo;s Most Vibrant Commercial Quarters</h4>\r\n<p>Eight stories above the vivacious thrum of Delmar Boulevard, a 10-foot-wide, 3,000-pound model of the moon&mdash;the largest such model in the world&mdash;spins in slow revolutions. Its surface is pocked in likeness of the real moon''s craterous topography, and as it moves&mdash;predictable and deliberate, like all celestial bodies&mdash;the eggshell color of its light half slowly gives way to the sooty hue of its dark side. The chromatic sequence plays out, seemingly in perpetuity, above the heads of the crowd gathered at the Moonrise Hotel''s Rooftop Terrace Bar, and down in the lobby a dynamic light wall and opalescent, LED-outfitted staircase cycle through the color spectrum, their vibrant undulations in dazzling contrast to the moon&rsquo;s simple hemispherical shading. Nearby, newly arrived guests gawk at the lush spectacle of the hotel&rsquo;s interior&mdash;the sleek, sometimes <em>Jetsons</em>-esque furniture, the towering fronds of a strelitzia nicolai plant, the ethereal, fire-toned Dale Chihuly glass chandelier suspended from the high ceiling above the second-floor mezzanine.</p>\r\n<p><img src="http://www.quangbinhtourism.vn/Portals/55/Upload/Travelling/Images/Hotel/Hotel-room-renaissance-columbus-ohio.jpg" alt="" width="346" height="229"></p>\r\n<p>&nbsp;</p>\r\n<p>After check-in, a walk to the elevators&mdash;which require a guest keycard to access the guest-room floors&mdash;takes travelers past a recessed glass case that displays Space Race&ndash;era curios, signed memorabilia, and a certified moon rock from the personal collection of hotel owner, Joe Edwards. The dim, partially black-lit hallways of the guestroom floors shroud visitors in a sense of privacy, and inside the Superior rooms, furnishings and d&eacute;cor resonate with lunar motifs, from artwork on the walls to polka-dot drapery delicately evoking the cycles of the moon. Serta Enrapture pillow-top beds bedecked with a profusion of pillows equip sleepers with a plush yet solid slumber platform even snugglier than a NASA administrator&rsquo;s feather-soft beard.</p>\r\n<p>From its ground-floor location, <a href="http://www.eclipsestlouis.com/">Eclipse Restaurant</a>&mdash;one of <em>St. Louis Magazine&rsquo;s</em> <a href="http://gr.pn/pg0ujc">Best New Restaurants of 2009</a>&mdash;delivers the updated American fare found on its full <a href="http://www.eclipsestlouis.com/gastronomy.asp">menus</a> to hotel rooms around the clock. For those who choose to dine at the restaurant, vivid comic-tinged paintings, low-backed leather booths, and &rsquo;60s-style chairs augment the quirkily upscale feel of the dining rooms. The breakfast menu features a series of creative benedicts, as well as french toast tweaked with a spiced eggnog-batter infusion. High above the restaurant at the Rooftop Terrace Bar, views of downtown St. Louis spread out to the east, including the iconic curvature of the Gateway Arch, rendered diminutive by distance. Along with the scenery, the bar serves up an abbreviated menu of appetizers prepared at Eclipse, complementing a spread of signature cocktails.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://t1.gstatic.com/images?q=tbn:ANd9GcSMlwVJTKqn5pgXU_zMl7G0Yr8_EuQqzCPCKmu8ZjQ5JSV_MZaE" alt="" width="274" height="184"></p>\r\n<h4>St. Louis: Green Gateway City</h4>\r\n<p>The six-block <a href="http://visittheloop.com/">Delmar Loop</a> district maintains a Main Street feel thanks to a panoply of dining and shopping outlets entwined with cultural and nightlife institutions. The neighborhood&rsquo;s more than 140 shops, eateries, and entertainment forums run the gamut from the casual espresso and conversation of Meshuggah Coffee House to the top-flight touring acts at <a href="http://www.thepageant.com/">The Pageant</a>, a 1,000+-capacity concert venue a few doors east of the Moonrise. Just across the street from the hotel, the <a href="http://gr.pn/qLmTmr">Little Shark Athletic Company</a> rents mountain, road, and tandem bicycles by the hour and day with a 10% discount to hotel guests. Alongside rentals, keen cycle sage Natalie Carroll dispenses bike maps, route recommendations, and suggestions on city highlights.</p>\r\n<p>About a half-mile south of the hotel, golfers, bikers, joggers, and walkers romp in the 1,293 verdant acres of <a href="http://gr.pn/qb78UE">Forest Park</a>, an enormous swath of urban greenery laced with 5.5 miles of trails. At high noon, sunbeams refract into a beckoning glare off the geometric fa&ccedil;ade of the <a href="http://gr.pn/oYvXFb">Jewel Box</a>, a small 1936 art deco greenhouse in the southeast quadrant of the park. Slightly west along the park''s Wells Drive, the renowned <a href="http://www.stlzoo.org/">Saint Louis Zoo</a> corrals hundreds of species of animals and herds of taxonomically inclined children, and to the north, the park''s <a href="http://gr.pn/qfVgOj">boathouse</a> allows visitors to take to the waters of Post-Dispatch Lake aboard pedal-powered craft.</p>\r\n<p>In the Southwest Garden Neighborhood 5 miles from Moonrise, the <a href="http://www.mobot.org/">Missouri Botanical Garden</a> sustains an enormous diversity of plant species in habitats such as the Buckminster Fuller&ndash;inspired <a href="http://www.mobot.org/explore/climatron.asp">Climatron</a> dome. Outdoors, butterflies flit among the many-hued blooms of the Daylily Garden, and large blue dragonflies hover and zip above lily pads and lotus flowers in the numerous ponds scattered across the grounds.</p>\r\n<p><img src="http://hotelworldnews.com/img/1545.jpg" alt="" width="399" height="303"></p>\r\n<p>The Gateway Arch&mdash;which at 630 feet is the tallest national monument in the National Parks system, more than twice as tall as the Statue of Liberty&mdash;offers a somewhat thrilling ride to its peak and, for those who make the ascent, bird''s-eye views of Mississippi riverboats and Busch Stadium. Doors at the visitors'' center and the Museum of Westward Expansion at the Jefferson National Expansion Memorial open at 8 a.m., lines get long around 10 a.m., and the day&rsquo;s tickets for tram rides to the top of the arch sometimes sell out in the afternoon.</p>', NULL, '2011-08-03 12:49:43'),
(4, 59, 2, 6, 0, 30, 0, '2011-08-01 00:00:00', '2011-08-15 16:00:00', 1, '2011-08-03 12:13:17', 24, 4, 6, 100, 0, 'USD', 32, 'Mlange Restaurant & Gastro Lounge  Downtown', 1.00, 100, '9.00', 0.00, 0.00, 0.00, 0, 0, 20, 'Mlange Restaurant & Gastro Lounge ', '644 6 Ave. SW Calgary, Alberta T2P 0S4 ', '098222222', 'www.yahoo.com', 983, '<div>\r\n<div><a name="fine_print"></a>\r\n<ul>\r\n<li>Expires Feb 6, 2012</li>\r\n<li>Limit 1 per person, may buy 2 additional as gifts. Limit 1 per table.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>\r\n</div>\r\n</div>', '<p>&bull; For $40, you get a two-course dinner for two (up to an $86.70 total value). <a href="http://www.groupon.com/deals/melange-restaurant-gastro-lounge/special_content">Click here for an overview of the courses</a>.<br> &bull; For $20, you get $40 worth of continental fare and drinks for lunch.</p>', '<p>Cooking food over an open flame can impart smoky flavor and seal in savoury juices, but cooking food over an eternal flame can get a bobsledding team kicked out of the Olympics. Get your fill of flame-cooked fare with today''s Groupon to <a href="http://gr.pn/oD3EqZ">M&eacute;lange Restaurant & Gastro Lounge</a>. Choose between the following options:</p>\r\n<p> For $40, you get a two-course dinner for two (up to an $86.70 total value). <a href="http://www.groupon.com/deals/melange-restaurant-gastro-lounge/special_content">Click here for an overview of the courses</a>.<br> &bull; For $20, you get $40 worth of continental fare and drinks for lunch.</p>\r\n<p></p>\r\n<p><img src="http://www.travelatvietnam.com/Photos/News/Vietnam-Food-Festival.jpg" alt="" width="282" height="282"></p>\r\n<p>At M&eacute;lange Restaurant & Gastro Lounge, patrons pair creations from a multifarious <a href="http://gr.pn/qMrBYS">menu</a> of gourmet selections from the sea, sky, land, and garden with domestic and imported beers. A selection of dim-sum appetizers changes weekly and allows diners to sample a culturally diverse treat without having to book a seat on an ornithopter. Four grown-up versions of the grilled-cheese sandwich come of age in the pan with a choice of four cheeses, including brie and fontina ($12&ndash;$14), and build-your-own burgers ($15) robe themselves in a choice of eight cheeses ($3&ndash;$5) as well as add-ons such as prosciutto or pancetta ($7&ndash;$8).</p>\r\n<p><img src="http://muivi.com/muivi/images/stories/baiviet/tung/natural_food.jpg" alt="" width="294" height="220"></p>\r\n<p>Patrons reenact famous duels with their forks and knives in black leather booths before sampling the featured vegetarian ($20) or seafood entrees ($22) or electing to divide and conquer the 6-ounce tenderloin steak ($33).</p>\r\n<p>&nbsp;</p>', NULL, '2011-08-03 13:15:41'),
(5, 54, 17, 2, 0, 30, 0, '2011-08-01 00:00:00', '2011-08-16 08:00:00', 1, '2011-08-03 12:19:01', 21, 0, 10, 100, 0, 'USD', 3, 'CrawlSF  Multiple Locations', 100.00, 90, '9.00', 10.00, 0.00, 0.00, 0, 0, 20, 'CrawlSF ', '65/7 Au Co F9 Q.Tan Binh TPHCM', '', '', 988, '<ul>\r\n<li>Expires Oct 1, 2011</li>\r\n<li>Limit 1 per person, may buy multiple as gifts. Must be 21 or older. VIP card is non-transferable.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>VIP access to five pub crawls</li>\r\n<li>Explore several neighborhoods</li>\r\n<li>Wild after parties</li>\r\n<li>Discounts on future events</li>\r\n</ul>', '<div>\r\n<p>Like spelunking, pub crawling shouldn&rsquo;t be done alone, without shoes, or 10 minutes before a job interview. Gear up for an adventurous descent into suds with today&rsquo;s Groupon: for $35, you get a VIP card and commemorative T-shirt from <a href="http://www.crawlsf.com/index.php">CrawlSF</a> (an $80 value). The VIP card grants each customer access to the following pub crawls and their after parties (not including the Crystal Castles concert after the August 6 crawl):</p>\r\n<ul>\r\n<li>9th Annual Union Street Pub Crawl on August 6 at 2 p.m.</li>\r\n<li>1st Annual Mission Pub Crawl on August 20 at 2 p.m.</li>\r\n<li>3rd Annual Clement Street Pub Crawl on September 3 at 4 p.m.</li>\r\n<li>9th Annual North Beach Bar Run on September 17 at 4 p.m.</li>\r\n<li>5th Annual Polk Village Pub Crawl on October 1 at 4 p.m.</li>\r\n</ul>\r\n<p>CrawlSF shepherds parched partiers across San Francisco&rsquo;s diverse panoply of pubs on boisterous daytime crawls followed by raucous after parties. Sip on a variety of sundry suds when populating such classic Union Street cantinas as Bar None and the Blue Light, or hug the walls of The Brick Yard while reciting a slurry welcoming speech. Imbibers can set off on the Mission Pub Crawl&rsquo;s maiden voyage, forging gallantly through the frothy oceans and affable pool sharks that surge through the Elbo Room, Skylark, and Pork Store Cafe&rsquo;s fully stocked alehouses. Crawls across Clement Street and Polk Village alight upon several of the area&rsquo;s most celebrated dives, and the massive North Beach Bar Run will try to top last year&rsquo;s crawl with stopovers at an endless array of shore-side spirit slingers.</p>\r\n<p><img src="http://www.itechnews.net/wp-content/uploads/2010/02/Locked-ON-Proximity-Sensing-T-Shirt.jpg" alt="" width="400" height="368"></p>\r\n<p>Each crawl grants VIPs incomparable vistas of the city&rsquo;s most eye-fetching neighborhoods, as well as enticing contests and commemorative swag from local sponsors. Prolong the festivities at uproarious after parties designed to elongate blissful buzzes and unleash twinkling toes against the beat of infectious live tunes and rhythmic burp-offs. Today&rsquo;s deal also includes a 2011 Pub Crawl T-shirt&ndash;fashioned in cuts for men and women&mdash;as well as access to discounted pre-sale tickets to one of CrawlSF&rsquo;s future holiday events or music festivals.</p>\r\n</div>', NULL, '2011-08-03 12:47:38'),
(6, 54, 3, 2, 0, 30, 0, '2011-08-01 00:00:00', '2011-08-25 08:00:00', 1, '2011-08-03 12:40:57', 17, 0, 1, 100, 0, 'USD', 19, 'Palomo Archery  Palomo Archery', 100.00, 70, '9.00', 30.00, 0.00, 0.00, 0, 0, 20, 'Palomo Archery', '843a Cong Hoa F11 Tan Binh', '(083) 8600364', 'http://newfoundlandpaintballsupply.com/sf-dev/', 997, '<ul>\r\n<li>Expires Feb 8, 2012</li>\r\n<li>Limit 1 per person. Limit 1 per visit. Valid only for option purchased. Must be 10 or older, under 18 must be accompanied by guardian. Must sign waiver.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>Certified instructors</li>\r\n<li>Learn the parts of a bow</li>\r\n<li>Aiming techniques</li>\r\n<li>Safe indoor range</li>\r\n</ul>', '<div>\r\n<p>Archery has been called the sport of kings, whereas being able to successfully dodge arrows has been called treason. Prepare for friendly regal competition with today''s Groupon to <a href="http://palomoarchery.com/">Palomo Archery</a> in Palo Alto. Choose between the following options:</p>\r\n<ul>\r\n<li>For $25, you get a one-hour archery lesson for two people plus equipment rental (a $50 value).</li>\r\n<li>For $40, you get four one-hour archery lessons for one person plus equipment rental (an $85 value).\r\n<p>&nbsp;</p>\r\n</li>\r\n</ul>\r\n<p>Palomo Archery''s certified <a href="http://gr.pn/q1aurF">instructors</a> teach bow beginners the fundamentals of safely aiming and shooting feathered projectiles from the comfort of a brightly lit indoor shooting range. Each one-hour lesson emphasizes various safety precautions as arrow slingers learn the different parts of a bow''s anatomy, various aiming strategies, and how to shoot an arrow without injuring any cartoon merry men in the vicinity. After each step in the tutorial, students cull fletching from quiver to practice incorporating the demonstrated technique themselves. Students can show up with nothing more than a pair of itchy quiver fingers, but seasoned archers, like amateur astronauts, are encouraged to bring their own equipment. To prevent mishaps, shooters should avoid wearing open-toe shoes, baggy clothing, or arrow pheromones.</p>\r\n</div>', NULL, '2011-08-03 12:47:22'),
(7, 60, 14, 2, 0, 50, 0, '2011-08-01 00:00:00', '2011-08-04 05:00:00', 1, '2011-08-03 12:52:18', 8, 0, 0, 100, 0, 'USD', 35, 'Moonrise Hotel  St. Louis, Missouri', 1.00, 100, '9.00', 0.00, 0.00, 0.00, 0, 0, 20, 'YouNet', '843A Ta Quang Buu F.5 Q.8', '', '', 1018, '<ul>\r\n<li>Check in: 3 p.m.</li>\r\n<li>Check out: Noon</li>\r\n<li>Parking: Valet included in Groupon</li>\r\n<li>Additional occupants: Up to three maximum occupants in Superior king rooms and up to four maximum occupants in Superior two-queen rooms; no additional charge</li>\r\n<li>Rollaways: Not available</li>\r\n<li>Smoking policy: No smoking inside the property</li>\r\n<li>Pet policy: Pets may be added for a $50 nonrefundable fee per stay.</li>\r\n<li>Accessibility: Handicap-accessible rooms are available upon request during booking.</li>\r\n<li>Room upgrades: Not available</li>\r\n</ul>', '<ul>\r\n<li>Expires Mar 31, 2012</li>\r\n<li>Limit 4 per person</li>\r\n<li>Limit 4 per visit</li>\r\n<li>48-hour cancellation notice or fee up to the price of Groupon may apply</li>\r\n<li>Not valid 8/24-8/27, 10/20-10/28, 12/30-12/31, or 2/11/12</li>\r\n<li>Must be 21 or older to check in</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<h4>Fashionably Eccentric Boutique Hotel in One of St. Louis&rsquo;s Most Vibrant Commercial Quarters</h4>\r\n<p>Eight stories above the vivacious thrum of Delmar Boulevard, a 10-foot-wide, 3,000-pound model of the moon&mdash;the largest such model in the world&mdash;spins in slow revolutions. Its surface is pocked in likeness of the real moon''s craterous topography, and as it moves&mdash;predictable and deliberate, like all celestial bodies&mdash;the eggshell color of its light half slowly gives way to the sooty hue of its dark side. The chromatic sequence plays out, seemingly in perpetuity, above the heads of the crowd gathered at the Moonrise Hotel''s Rooftop Terrace Bar, and down in the lobby a dynamic light wall and opalescent, LED-outfitted staircase cycle through the color spectrum, their vibrant undulations in dazzling contrast to the moon&rsquo;s simple hemispherical shading. Nearby, newly arrived guests gawk at the lush spectacle of the hotel&rsquo;s interior&mdash;the sleek, sometimes <em>Jetsons</em>-esque furniture, the towering fronds of a strelitzia nicolai plant, the ethereal, fire-toned Dale Chihuly glass chandelier suspended from the high ceiling above the second-floor mezzanine.</p>', NULL, '2011-08-03 13:16:18'),
(8, 59, 8, 2, 0, 30, 1, '2011-08-01 00:00:00', '2011-08-15 16:00:00', 0, '2011-08-03 13:02:23', 9, 0, 2, 100, 0, 'USD', 17, 'The Clayground Ceramic Painting Studio  The Clayground', 20.00, 50, '9.00', 10.00, 0.00, 0.00, 0, 0, 20, 'The Clayground', '298 Le Duan BenNghe Tan Phu', '(083) 8600361', 'www.netcafe.com', 1027, '<ul>\r\n<li>Expires Feb 5, 2012</li>\r\n<li>Limit 1 per person, may buy 3 additional as gifts. Limit 1 per visit. Subject to availability. Classes are non-transferable. Reservations recommended for weekends.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>Paint-your-own-pottery studio</li>\r\n<li>300+ ceramic mugs & shapes</li>\r\n<li>Water-based, non-toxic paint</li>\r\n<li>Kiln-fired piece in 5&ndash;7 days</li>\r\n</ul>', '<div>\r\n<p>Hand-painted pottery has a rich legacy of storytelling, from the Grecian urns that document the perils of Orpheus and Eurydice to modern coffee mugs that foretell epic tales of the world''s greatest grandpa. Paint your own story with today''s Groupon: for $15, you get $30 worth of ceramics painting at <a href="http://www.theclayground.ca/">The Clayground Ceramic Painting Studio</a>, located in the Avenida Shopping Centre.</p>\r\n<p><img src="http://www.medicinalmushroomcoffee.com/homepage/a-coffee-cup.jpg" alt="" width="200" height="200"></p>\r\n<p>The Clayground gives clay-painters of all ages a plethora of ceramic shapes to decorate with individual panache, and they return a week later to pick up their kiln-fired and clear-glazed creation. A genial army of more than 300 ceramic mugs, plates, animals, jewellery boxes, and other blank slates await their destinies in a bright, cheerfully painted <a href="http://www.theclayground.ca/studiopics.aspx">studio</a>. Visually minded staffers, stencils, and template books provide design recommendations such as the average number of eyes on a horse, but artisans may wield their ceramics brushes and more than 60 colours of paint in any configuration made possible by the human imagination or a surge in blood sugar. Prices range from $8 to $125, and the majority of projects typically range from $15&ndash;$30, including supplies and The Clayground&rsquo;s water-based, non-toxic paints.</p>\r\n<p>After the pottery adornment is complete, maestros part with their brainchildren for 5&ndash;7 days and return to find them safely kiln fired and clear gazed. Since Grecian urns hog all the attention, painters may choose to celebrate the homecoming of their piece with an ode.</p>\r\n<p><img src="http://assets1.grouponcdn.com/images/site_images/1407/0620/The-Clayground_grid_6.jpg?rm7N7KN6" alt="" width="440" height="267"></p>\r\n</div>', NULL, '2011-08-03 13:06:41'),
(9, 54, 3, 6, 0, 30, 0, '2011-08-05 08:00:00', '2011-08-22 08:00:00', 1, '2011-08-03 13:35:23', 1, 0, 7, 500, 0, 'USD', 30, 'START Fitness  Pacific Heights', 80.00, 75, '9.00', 20.00, 0.00, 0.00, 0, 0, 20, 'START Fitness', '799 Water St. St. John''s, Newfoundland A1C 1E3', '(709) 726-9932', '', 1040, '<ul>\r\n<li>Expires Aug 7, 2012</li>\r\n<li>Limit 1 per person, may buy 3 additional as gifts. Limit 1 per visit. Only valid for 7AM class. Registration required. New clients only. Must redeem classes in full by 8/7/12.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>Burn up to 800 calories an hour</li>\r\n<li>Indoor & outdoor workouts</li>\r\n<li>Varied exercise routines</li>\r\n<li>Inspired by military training</li>\r\n</ul>', '<div>\r\n<p>Muscle definition is challenging fitness goal, achievable only through months of regimented strength training or one afternoon of bench-pressing a dictionary. Define your fitness goals with today&rsquo;s Groupon: for $40, you get two weeks of boot-camp classes at <a href="http://www.startfitness.com/">START Fitness</a>, valid at the <a href="http://www.startfitness.com/san_francisco,_ca/program_details/index.html">Bush Street location</a> for the 7 a.m. to 8 a.m. session running Monday&ndash;Friday (a $160 value).</p>\r\n<p>Launched by six-time Soldier of the Year and master fitness trainer <a href="http://www.sgtken.com/">Ken Weichert</a>, START Fitness sends recruits through military-training-inspired routines combining cardio and strength training to help participants burn up to 800 calories an hour. Outside, fresh air fuels an early-morning mix of endurance runs, interval training, and tempo runs up and down San Francisco''s high-grade hills. Indoors, instructors crank the upbeat music to motivate students through push-ups, flutter kicks, vertical leg crunches, partner-assisted exercises, and endurance tap dancing. Throughout the weekly <a href="http://gr.pn/qhAtqY">schedule</a>, varying exercise itineraries keep the body guessing with unique challenges from obstacle courses to rice counting.</p>\r\n</div>', NULL, '2011-08-04 11:58:00'),
(10, 59, 2, 6, 0, 40, 0, '2011-08-04 03:00:00', '2011-08-04 07:16:37', 1, '2011-08-04 03:42:57', 18, 0, 100, 100, 1, 'USD', 35, 'Opus Hotel Montreal  Montreal, Quebec, Canada', 300.00, 67, '9.00', 100.00, 0.00, 0.00, 0, 0, 20, 'Opus Hotel Montreal', '644 6 Ave. SW Calgary, Alberta T2P 0S4', '0987776545', 'http://www.yahoo.com', 1045, '<ul>\r\n<li>Expires Dec 30, 2011</li>\r\n<li>Limit 2 per person, may buy 2 additional as gifts</li>\r\n<li>Limit 2 per visit</li>\r\n<li>Not valid 09/23/11-09/24/11, 10/01/11, or 11/16/11-11/17/11</li>\r\n<li>Valid only for option purchased</li>\r\n<li>Must cancel by 4pm on the day before arrival or fee up to Groupon price may apply</li>\r\n<li>Choose a date before expiration date</li>\r\n<li>Must be 18 or older to book</li>\r\n<li>Must be 18 or older to consume alcohol</li>\r\n<li>Not valid with reward points</li>\r\n<li>Credit card required at check-in</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>For $161 CAN, a one-night stay in a deluxe room for up to two adults&nbsp;&nbsp;</li>\r\n<li>Or, for $251 CAN, a one-night stay in a junior suite for up to two adults</li>\r\n</ul>\r\n<p><strong>Included in all options:</strong><strong></strong></p>\r\n<ul>\r\n<li>Welcome cocktail for two * Breakfast for two&nbsp;&nbsp;</li>\r\n<li>Valet parking</li>\r\n<li>In-room hi-speed Internet access</li>\r\n</ul>', '<h4>Stylish Escape in the Thick of Montreal Nightlife</h4>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Some time after the last of the <br>Saturday-night dinner guests have departed and the plates have been <br>cleared away, the outdoor terrace of Opus Hotel Montreal&rsquo;s Koko <br>Restaurant + Bar erupts. Under the terrace''s white canopy, the sonic <br>schemes of live DJs infiltrate crowds of interlocked figures aglow from <br>their dancing and phosphorescent drinks. The sound of the revelry floats<br> through the walls of the building, the first poured-concrete building <br>in North America, and those of its adjoining modern concrete addition. <br>Collectively, its these two structures that make up the distinctive <br>hotel, forming a dichotomous framework that parallels the Opus Hotel <br>Montreal&rsquo;s dual lives: throughout the week, a stylized retreat for <br>businesspeople and sightseers; on the weekend, an entertainment hub <br>where jetsetters alight to commingle at one of Montreal&rsquo;s most <br>adrenalized nightlife destinations.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>A stylish corollary to the opulent <br>on-site restaurant, the Opus Hotel Montreal&rsquo;s spacious lobby is <br>meticulously outfitted with leather divans, fresh flowers, and textured <br>abstract paintings. The central aesthetic is minimalism, a design <br>concept that makes its way up the corkscrew concrete staircase and the <br>tangle of ironwork curls that constitute its bannister&mdash;relics from the <br>original avant-garde structure&mdash;and into the hotel&rsquo;s <a href="http://www.opushotel.com/montreal/english/rooms_suites.html">136 guest rooms</a>.<br> There, walls awash in electric grapefruit, plum, honeydew, or orange <br>hues contrast with sable-toned bed frames and the natural light pouring <br>in through the bevy of windows. In the bathrooms, the pressure-perfect <br>streams of the glass-walled walk-in showers compete for bathers&rsquo; <br>attention with the separate soaking tubs, which are deep enough to <br>comfortably subsume an adult male or fully grown mannequin. King beds <br>beckon drowsy travelers, and in <a href="http://www.opushotel.com/montreal/english/rooms_2_junior.html">junior suites</a>, a separate sitting area sports a full-size sofa. On Friday and Saturday nights, the <a href="http://www.irhas.com/Main/ConceptualDesignAwards_Recipients.php">award-winning</a><br> Koko Restaurant + Bar transforms into a nightclub on the first <br>floor&mdash;though the club''s music may reach rooms on lower floors, Opus <br>Hotel Montreal provides complimentary ear plugs and takes requests for <br>quieter rooms.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Underneath the lobby, a hallway art gallery showcases the work of local artists, and <a href="http://www.kokomontreal.com/#/home/">Koko Restaurant + Bar </a>&mdash;in<br> the hours prior to its nightclub metamorphosis&mdash;showcases masterpieces <br>of nouveau sushi and exquisite Italian fare. Warm nights bring diners to<br> the terrace, a m&eacute;lange of purple-and-gunmetal couch seating and a few <br>scattered tables, and the chandeliered interior casts refracted golden <br>light onto shrimp and smoked-prosciutto sushi rolls and the <br>parmesan-and-dijon crust of the rack of lamb. In the morning, an in-room<br> breakfast might include the oven-born bounty of nearby St-Viateur <br>Bagel, a tasty foundation to a day of urban exploration.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<h4>Montreal&rsquo;s Entertainment District: Vibrant Festivals Tucked Between Trendy Neighborhoods</h4>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>The siren song of European fashion and <br>the smell of freshly baked bread coax hotel guests to the Boulevard <br>Saint-Laurent, known as The Main, on which the Opus Hotel Montreal sits.<br> Ambling northwest, adventurers encounter the Plateau neighborhood and <br>its fanciful restaurant, gallery, caf&eacute;, and boutique fa&ccedil;ades, each vying<br> for the attention of shoppers in looping French script. Fortunate <br>travelers will encounter a short line outside of <a href="http://www.schwartzsdeli.com/">Schwartz&rsquo;s</a>,<br> where guardians of an 83-year-old secret recipe spice, marinate, and <br>smoke their world-renowned meats for a combined 10.5 days. Stomachs <br>filled to sandwich capacity can be resuscitated with a self-guided tour <br>of the Plateau&rsquo;s private residences, many of which sport Montreal&rsquo;s <br>characteristic snaked staircases, artisan balconies, and ornate <br>cornices.</p>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n<p>Old Montreal, a 20-minute hike from the <br>hotel door, merits its reputation as a displaced slice of Europe. <br>Surprisingly expansive, the neighborhood&rsquo;s bricked avenues twist and <br>turn like perjuring witnesses, and a designated pedestrian zone recalls <br>the city as it once was: cramped, bustling, and brilliant. <br>Out-of-towners are advised to negotiate the labyrinth, which can be <br>difficult to navigate even with a map, on its own terms. Around a bend <br>awaits the Rue des Artistes, a narrow strait populated by painters <br>hawking their wares, the unfurled smoke of their pipes forming an <br>ephemeral cloud ceiling. Nearby, street performers juggle and pander to <br>the gathered crowds for tips and plaudits. The city&rsquo;s hottest dining <br>destinations set up shop here, including <a href="http://resto-lelocal.com/index_en.html">Le Local</a>, an ultrasleek restaurant that serves up formidable French fare with a laundry list of ingredients in every entree.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n<p>Every summer Sunday from noon to dusk, <br>the city of Montreal congregates atop Mont Royal in a celebration of <br>life, love, and inclusion known simply as <a href="http://gr.pn/qo33XC">Tam Tams</a>.<br> Citizens of all ages gather to take in the spectacle, which <br>concentrates around the mountain&rsquo;s famous angel statue. Upwards of 30 <br>musicians wielding the drums for which the festival is named form a <br>circle in a concrete hollow. Nearby, tightrope walkers balance between <br>trees, and past the hill fully grown men and intrepid children don armor<br> and engage in recreational combat, using duct-tape-blunted swords and <br>halberds and kicking up dust on their well-tread battlefield. Tam Tams <br>are just one of the dozens of festivals that call Montreal home; savvy <br>travelers will consult a <a href="http://gr.pn/r51MlJ">calendar</a> before booking trips.</p>', NULL, '2011-08-04 03:57:29'),
(11, 59, 19, 3, 0, 50, 1, '2011-08-04 16:00:00', '2011-08-15 16:00:00', 1, '2011-08-04 03:55:00', 0, 0, 0, 10, 0, 'USD', 1, 'Test Deal ', 1.00, 100, '9.00', 0.00, 0.00, 0.00, 0, 0, 30, 'YouNet', '65/7 au co p9 tan binh', '0987654567', '', 1058, '<p>Compose your new deal below, then click "Post Deal" to publish deal.</p>', '<p>Compose your new deal below, then click "Post Deal" to publish deal.</p>', '<p>Compose your new deal below, then click "Post Deal" to publish deal.</p>', NULL, '2011-08-04 03:55:00'),
(12, 54, 22, 5, 0, 50, 1, '2011-08-04 20:50:00', '2011-08-10 08:00:00', 1, '2011-08-04 06:59:07', 0, 0, 0, 50, 0, 'USD', 10, 'Festival Opera  Lesher Center for the Arts', 201.00, 90, '9.00', 20.00, 0.00, 0.00, 0, 0, 30, 'Festival Opera', '1601 Civic Dr. Walnut Creek, California 94596 ', '(925) 943-746', '', 1063, '<ul>\r\n<li>Expiration varies</li>\r\n<li>Limit 2 per person. Valid only for option purchased. <strong>Must show valid ID matching name on Groupon at Lesher Center for the Arts box office.</strong> Tickets for all shows can be picked up 24 hours after purchase of Groupon.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>Lively, romantic comedy</li>\r\n<li>Classic Frank Loesser musical</li>\r\n<li>Great date idea</li>\r\n</ul>', '<div>\r\n<p>The history of theater goes all the way back to the 1970s, when audiences were eager to see "living movies." See how far these unfilmed talkabouts have come in only 40 years with today''s Groupon to <a href="http://gr.pn/nhVP7U"><em>The Most Happy Fella</em></a>, presented by <a href="http://gr.pn/r0zINW">Festival Opera</a> at the <a href="http://gr.pn/pydxiU">Lesher Center for the Arts</a>, located in Walnut Creek. Choose from the following date and seating options:</p>\r\n<p>&bull; For $49, you get two standard seat tickets to the performance on Saturday, August 6 at 8 p.m. (a $98 value).<br> &bull; For $59, you get two superior seat tickets to the performance on Saturday, August 6 at 8 p.m. (a $118 value).<br> &bull; For $39, you get two standard seat tickets to the performance on Tuesday, August 9 at 2 p.m. (a $78 value).<br> &bull; For $49, you get two superior seat tickets to the performance on Tuesday, August 9 at 2 p.m. (a $98 value).<br> &bull; For $39, you get two standard seat tickets to the performance on Friday, August 12 at 8 p.m. (a $78 value).<br> &bull; For $49, you get two superior seat tickets to the performance on Friday, August 12 at 8 p.m. (a $98 value).</p>\r\n<p>In celebration of his company''s 20th-anniversary season, Festival Opera founder and accomplished baritone Theodore Weis assumes the role of a love-struck winemaker pursuing an enchanting waitress in <em>The Most Happy Fella</em>. Weis takes his fourth turn in the role of middle-aged bachelor Tony Esposito as he attempts to woo young Rosabella&mdash;soprano <a href="http://gr.pn/oHEYFQ">Shawnette Sulker</a>&mdash;through love letters and a deceptive photograph of a handsome farmhand. Double-threat composer and lyricist Frank Loesser, whose wit and soaring melodies endeared audiences to <em>Guys and Dolls</em>, set this rollicking Cyrano de Bergerac&ndash;like romance amid the bustle of 1920s San Francisco and the quiet of Napa Valley vineyards. Toes tap to the cheerfully wistful ditty "Standing on the Corner" and loudly holler their love of Larry Hagman during "Big D," the full-cast celebration of Dallas.</p>\r\n<p>Festival Opera curates up-and-coming songbirds and directors to form the third-largest opera company in the Bay Area. The Lesher Center for the Arts grew from a community desire for theater kindled in 1967, culminating in 1990 with a $21-million mixed-use facility whose grand Hoffman Theater boasts a <a href="http://gr.pn/nsI8xU">seating chart</a> complete with boxes, a spacious orchestra, and balcony.</p>\r\n</div>', NULL, '2011-08-04 06:59:08'),
(13, 59, 14, 6, 0, 30, 0, '2011-08-04 09:50:00', '2011-08-24 16:00:00', 1, '2011-08-04 07:57:57', 13, 0, 0, 1000, 0, 'USD', 100, 'Artistic Esthetic Spa  Central London', 100.00, 80, '9.00', 20.00, 0.00, 0.00, 0, 0, 20, 'Artistic Esthetic Spa ', '191 Central Ave. London, Ontario N6A 1M6 ', '(519) 433-6245 ', 'http://www.artisticspa.ca/', 1068, '<ul>\r\n<li>Expires Oct 31, 2011</li>\r\n<li>Limit 1 per person, may buy 5 additional as gifts. Limit 1 per visit. 24hr cancellation notice required. New clients only. Spa package is non-transferable.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>Massage, exfoliation & manicure</li>\r\n<li>Body-care consultation</li>\r\n<li>Herbal tea & fruit</li>\r\n</ul>', '<div>\r\n<p>Booking your body double a beautifying treatment at a tranquil day spa creates a soundproof alibi for days spent stealing office supplies from the Canadian Forces. Make your stand-in stand out with today&rsquo;s Groupon: for $55, you get a two-visit spa package at <a href="http://gr.pn/ri1yuT">Artistic Esthetic Spa</a> (a $195 value).</p>\r\n<p><img src="http://www.keyweightloss.com.vn/UserFiles/News/155201111506703.jpg" alt="" width="300" height="300"></p>\r\n<p>Artistic Esthetic Spa remains one of London''s largest privately owned and operated day spas, enveloping spa-goers in a calming atmosphere and funky, nature-inspired decor. At their initial visit, patrons relax with an Express-O manicure, during which skilled manicurists shape nails, push back cuticles, and apply a hydrating treatment cream before coating the customer''s fingers in a choice of polish.</p>\r\n<p><img src="http://vietpages.com.vn/img/spa3.jpg" alt="" width="231" height="182"></p>\r\n<p>Skilled staff members coddle hands with a citrus scrub and warm paraffin treatment, dance digits over lower limbs during a relaxing foot and lower leg massage, and bathe toes in an aromatherapy foot bath. During the second spa outing, visitors learn body-bolstering tips during a personalized body-care consultation and then treat their backs to an exfoliating ultimate sweet and sea salt polish and a therapeutic hot oil treatment. Finally, tense arms relax during a massage with essential oils, and spa visitors leave with a complementary skincare sample. Throughout each spa visit, patrons can nibble fresh fruit and remove outdated skin wallpaper with the steam from a detoxifying herbal tea.</p>\r\n<p><img src="http://branding.vn/upload/thum/1303202634_branding_spa.jpg" alt="" width="325" height="175"></p>\r\n<p>Customers can also opt to return for a third visit to makeover their heads and last year''s jack-o''-lanterns with a half-off core facial for $47.50 (usually $95). A $25 pedicure augments the first visit (usually $59) and can include french polish for an extra $7, and a $20 30-minute massage (usually $40) soothes muscles during the second visit, and 20% off all waxing services expunges unwanted hair follicles. Upgrades may be purchased separately.</p>\r\n</div>', NULL, '2011-08-04 08:23:08'),
