(15, 54, 3, 6, 0, 10, 0, '2011-08-09 08:00:00', '2011-08-17 08:00:00', 1, '2011-08-04 12:10:23', 0, 0, 0, 1000, 0, 'USD', 100, 'Sutter Dental  San Francisco', 200.00, 75, '0.00', 50.00, 0.00, 0.00, 0, 0, 10, 'http://www.groupon.com/deals/sutter-dental-2 $89 http://www.groupon.com/images/site_images/1425/9614/DoctorBase2.jpg Sutter Dent', '799 Water St. St. John''s, Newfoundland A1C 1E3', '(709) 726-9932', 'http://www.gmail.com', 1106, '<ul>\r\n<li>Expiration varies</li>\r\n<li>Limit 1 per person, may buy 2 additional as gifts. Limit 1 per visit. Valid only for option purchased. 48hr cancellation notice required. New clients only. Services are non-transferable.</li>\r\n<li><a href="http://www.groupon.com/pages/universal-fine-print">See the rules</a><span> that apply to all deals.</span></li>\r\n</ul>', '<ul>\r\n<li>Fade enamel stains</li>\r\n<li>Cleaning fights tartar & plaque</li>\r\n<li>Cosmetic dentistry focus</li>\r\n<li>Knowledgeable staff</li>\r\n</ul>', '<div>\r\n<p>In the Elizabethan days, blackened teeth were attractive because they identified their owner as a member of the sugar-crazed nobility. Embrace the sparkling shift in mouth-based desirability with today''s Groupon to <a href="http://www.sutterdentalsf.com/">Sutter Dental</a>, located in Union Square''s historic <a href="http://www.450sutter.com/">450 Sutter Building</a>, which has housed dental professionals since 1930. Choose between two options:</p>\r\n<p>&bull; For $89, you get a cleaning (a $119 value), exam (a $129 value), and x-rays (a $149 value), (a $397 total value).<br> &bull; For $195, you get a Zoom! teeth-whitening treatment (a $599 value).<br> <br> <a href="http://www.sutterdentalsf.com/?page_id=3">Dr. Gary Arabatyan</a> and the team at Sutter Dental keep mouth-parts in working order with their commitment to preventative care, minimally invasive treatment options, and fully discussing each procedure with their clients. During each comprehensive exam, Dr. Arabatyan will plumb a mouth&rsquo;s hidden depths, spelunking in search of cavities, cracks, and treasure maps scrawled on the inside of cheeks. Then, technicians forecast immediate dental futures by snapping instantaneous images of teeth and gums with two posteroanterior and four bitewing x-rays. Finally, a thorough cleaning shakes stuck-on tartar and sticky plaque before they become a bacteria-laden buzzkill.</p>\r\n<p>Thanks to a pretreatment exam and consultation, clients begin the <a href="http://www.zoomnow.com/about.php">Zoom! treatment</a> with a fully informed brain and fully mapped mouth. A hydrogen-peroxide gel lovingly caresses each tooth as Zoom!''s specialized light inspires its chemicals to action, or at least to write a strongly worded letter. Over the course of three 15-minute sessions, Zoom!''s lamps blaze away stains and enamel darkening, leading to a brighter, flashier smile.</p>\r\n</div>', NULL, '2011-08-08 18:04:12'),
(16, 63, 15, 5, 0, 10, 0, '2011-08-09 01:00:00', '2011-08-09 23:00:00', 0, '2011-08-04 12:34:15', 0, 4, 0, 10, 0, 'USD', 3, 'Elements Therapeutic Massage  Multiple Locations', 89.00, 56, '0.00', 39.00, 0.00, 0.00, 0, 0, 10, 'Exquisite Nail Boutique', 'Palatine ,395 W Northwest Hwy.  Palatine, Illinois 60067  (847) 963-1600 ', '', '', 1111, '<p>additional as gifts. Limit 1 p</p>\r\n<p>&nbsp;</p>', '<p>Deep-tissue work erases knots</p>\r\n<p>Relaxing Swedish methods</p>\r\n<p>Progressively intense levels of massage</p>', '<p>The Hamburglar started out as a hand burglar but soon found that unkempt&nbsp;</p>', NULL, '2011-08-04 12:34:15');
